import React, {Component} from "react";
import styled from "styled-components";
import axios from "axios";

class People extends Component{
state = {
    originalCard :{},
    renderCard : []
}

componentDidMount =()=>{

    axios.get("https://swapi.co/api/people")
    .then((res)=> { 
        console.log("res: "+ res.data)
        this.setState({originalCard: res.data})} );

    console.log(this.state.originalCard);
}

   render(){
    return(
        <Wrapper>
            <Title>People</Title>

            {this.originalCard.map((x)=>{
                return <div>
                    <p>Name: {x.name}</p>
                </div>
            })}

        </Wrapper>
    )
    }
}

export {People}

const Wrapper = styled.div``;

const Title = styled.div``;
